import React from "react";

function Nav() {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-primary">
      <a className="navbar-brand text-uppercase text-justify-center" href="/">
        Zach's World of Retail
      </a>
    </nav>
  );
}

export default Nav;
